// src/pages/ICCPage.tsx
import React, { useEffect, useState } from 'react';
import {
  ICCSetup,
  normalizeSetup,
  validateSetup,
  groupByTag,
  groupByTimeBlock,
  filterMalformed,
  routeToDashboard,
} from '../utils/ICCSetupHandler';

// Example: mock setups for demonstration
const rawSetups: Partial<ICCSetup>[] = [
  { id: '1', symbol: 'AAPL', tag: 'momentum', timeBlock: 'regular', score: 85 },
  { id: '2', symbol: 'TSLA', tag: 'trend', timeBlock: 'pre-market', score: 72 },
  { id: '3', symbol: 'MSFT', tag: 'warrior', timeBlock: 'after-hours', malformed: true },
  { id: '4', symbol: 'GOOG', tag: 'momentum', timeBlock: 'regular', score: 90 },
];

export default function ICCPage() {
  const [setups, setSetups] = useState<ICCSetup[]>([]);
  const [validSetups, setValidSetups] = useState<ICCSetup[]>([]);
  const [malformedSetups, setMalformedSetups] = useState<ICCSetup[]>([]);
  const [tagGroups, setTagGroups] = useState<Record<string, ICCSetup[]>>({});
  const [timeBlockGroups, setTimeBlockGroups] = useState<Record<string, ICCSetup[]>>({});

  useEffect(() => {
    // Normalize raw setups
    const normalized = rawSetups.map(normalizeSetup);

    // Separate valid vs malformed
    const valid = normalized.filter(validateSetup);
    const malformed = filterMalformed(normalized);

    // Group setups
    const byTag = groupByTag(valid);
    const byTimeBlock = groupByTimeBlock(valid);

    setSetups(normalized);
    setValidSetups(valid);
    setMalformedSetups(malformed);
    setTagGroups(byTag);
    setTimeBlockGroups(byTimeBlock);
  }, []);

  return (
    <div style={{ padding: '1rem' }}>
      <h1>ICC Dashboard</h1>

      <section>
        <h2>All Setups</h2>
        <ul>
          {setups.map((s) => (
            <li key={s.id}>
              {s.symbol} — {s.tag} — {s.timeBlock} — Score: {s.score} — Routed to: {routeToDashboard(s)}
            </li>
          ))}
        </ul>
      </section>

      <section>
        <h2>Valid Setups</h2>
        <ul>
          {validSetups.map((s) => (
            <li key={s.id}>
              ✅ {s.symbol} ({s.tag}, {s.timeBlock})
            </li>
          ))}
        </ul>
      </section>

      <section>
        <h2>Malformed Setups</h2>
        <ul>
          {malformedSetups.map((s) => (
            <li key={s.id}>
              ⚠️ {s.symbol} ({s.tag}, {s.timeBlock})
            </li>
          ))}
        </ul>
      </section>

      <section>
        <h2>Grouped by Tag</h2>
        {Object.entries(tagGroups).map(([tag, setups]) => (
          <div key={tag}>
            <h3>{tag}</h3>
            <ul>
              {setups.map((s) => (
                <li key={s.id}>{s.symbol} ({s.timeBlock})</li>
              ))}
            </ul>
          </div>
        ))}
      </section>

      <section>
        <h2>Grouped by TimeBlock</h2>
        {Object.entries(timeBlockGroups).map(([block, setups]) => (
          <div key={block}>
            <h3>{block}</h3>
            <ul>
              {setups.map((s) => (
                <li key={s.id}>{s.symbol} ({s.tag})</li>
              ))}
            </ul>
          </div>
        ))}
      </section>
    </div>
  );
}
